from math import gcd

def count_unique_friendly_divisors(n, f, unfriendly_numbers):
    divs = []
    for i in range(1, int(f ** 0.5) + 1):
        if f % i == 0:
            divs.append(i)
            if i != f // i:
                divs.append(f // i)
    ndivs = set()
    for u in unfriendly_numbers:
        ndivs.add(gcd(f, u))
    rt = 1
    for d in divs:
        for nd in ndivs:
            if nd % d == 0:
                break
        else:
            rt += 1
    return rt

